# 一、简介

anime.js 是一款功能强大的Javascript 动画库插件。anime.js 可以和CSS3 属性，SVG，DOM 元素和JS 对象一起工作，制作出各种高性能，平滑过渡的动画效果。

# 二、安装与使用

## 安装

```html
<!-- html中，下载压缩的js -->
<script type="text/javascript" src="js/anime.min.js"></script>
```

```javascript
// vue中
// npm安装
npm i animejs

// 引入
import anime from 'animejs/lib/anime.js'
```

## 使用

```javascript
var myAnimation = anime({
  targets: '.blue',
  translateX: 250,
  easing: 'easeInOutQuad',
  loop: true,
  duration: 3000
});
```

# 三、常用配置参数介绍

| 参数      | 意义      |  默认值  | 其他 |
| --------- | -------- | ----- | -- |
| targets | 设置动画的DOM元素 | 无 | 必填 |
| delay | 延迟 | 0 | 取值为number，或function(el, index, total)，单位毫秒 |
| duration | 持续时间 | 1000 | number，或function(el, index, total)，单位毫秒 |
| autoplay | 自动播放 | true | boolean |
| loop | 循环播放 | false | number，boolean |
| direction | 播放顺序 | "normal" | "normal"，"reverse"，"alternate" |
| easing | 时间曲线 | "easeOutElastic" | "linear"，多而不列 |
| begin | 动画开始 | undefined | 动画开始时执行 |
| update | 每次变化 | undefined | 每次变化时执行 |
| complete | 动画结束 | undefined | 动画结束时执行 |

# 四、详解

## 动画的目标对象（targets）

### 1. CSS选择器

```javascript
anime({
  targets: '.css-selector .el',
  translateX: 250
});
```

### 2. DOM元素/元素集合

```javascript
anime({
  targets: document.getElementById('demo');
  translateX: 250
});
```

### 3. JS对象

```javascript
var logEl = document.querySelector('.battery-log');

var battery = {
  charged: '0%',
  cycles: 120
}

anime({
  targets: battery,
  charged: '100%',
  cycles: 130,
  round: 1,
  easing: 'linear',
  update: function() {
    logEl.innerHTML = JSON.stringify(battery);
  }
});
```

### 4. 数组

```javascript
var el = document.querySelector('.mixed-array-demo .el-01');
var obj = {num: 1};

anime({
  targets: [el, '.mixed-array-demo .el-02', obj], // 支持混搭
  translateX: 250
});
```

## 可动画的目标属性

### 1. CSS属性

大部分的CSS属性都会导致布局更改或重新绘制，并会导致动画不稳定。因此尽可能优先考虑opacity和CSS transform。

```javascript
anime({
  targets: '.css-prop-demo .el',
  left: '240px',
  backgroundColor: '#FFF',
  borderRadius: ['0%', '50%'],
  easing: 'easeInOutQuad'
});
```

### 2. CSS3 transform属性

可以为每个变换属性指定不同的排序，具体可查看特殊属性部分。

```javascript
anime({
  targets: '.css-transforms-demo .el',
  translateX: 250,
  scale: 2,
  rotate: '1turn', // 旋转一圈
});
```

### 3. JS对象属性

包含数值的任何对象属性都可以设置动画。

```
var objPropLogEl = document.querySelector('.js-object-log');

var myObject = {
  prop1: 0,
  prop2: '0%'
}

anime({
  targets: myObject,
  prop1: 50,
  prop2: '100%',
  easing: 'linear',
  round: 1,
  update: function() {
    objPropLogEl.innerHTML = JSON.stringify(myObject);
  }
});
```

### 4. DOM属性

任何包含数值的DOM属性都可以设置动画。

```
anime({
  targets: '.dom-attribute-demo input', // 这是一个输入框
  value: [0, 1000], // input的value属性
  round: 1,
  easing: 'easeInOutExpo'
});
```

### 5. SVG属性

与任何其他DOM属性一样，包含至少一个数值的所有SVG属性都可以设置动画。

```javascript
anime({
  targets: ['.svg-attributes-demo polygon', 'feTurbulence', 'feDisplacementMap'],
  points: '64 128 8.574 96 8.574 32 64 0 119.426 32 119.426 96',
  baseFrequency: 0,
  scale: 1,
  loop: true,
  direction: 'alternate',
  easing: 'easeInOutExpo'
});
```

## 动画基础参数

### 1. duration（持续时间）

定义动画的持续时间（以毫秒为单位）。

| TYPE | DEFAULT | EXAMPLE |
| --- | --- | --- |
| Number | `1000` | `3000` |
| anime.stagger | See staggering section | `anime.stagger(150)` |
| Function | See function based parameters section | `(el, i) => i * 150` |

### 2. delay（延迟）

定义动画的延迟（以毫秒为单位）

| TYPE | DEFAULT | EXAMPLE |
| --- | --- | --- |
| Number | `0` | `3000` |
| anime.stagger | See staggering section | `anime.stagger(150)` |
| Function | See function based parameters section | `(el, i) => i * 150` |

### 3. endDelay（末端延迟）

在动画结束时以毫秒为单位添加一些额外时间。

| TYPE | DEFAULT | EXAMPLE |
| --- | --- | --- |
| Number | `0` | `1000` |
| anime.stagger | See staggering section | `anime.stagger(150)` |
| Function | See function based parameters section | `(el, i) => i * 150` |

### 4. round（数字格式）

### 5. 特殊属性

使用Object作为值为动画的每个属性定义特定参数。
未在Object中指定的其他属性继承自主动画。

```javascript
anime({
  targets: '.specific-prop-params-demo .el',
  translateX: {
    value: 250,
    duration: 800
  },
  rotate: {
    value: 360,
