```

### 6. 函数返回数值

为动画的每个目标和属性设置不同的值。
function 接受三个参数:
| ARGUMENTS | INFOS |
| --- | --- |
| `target` | 当前动画目标元素 |
| `index` | 动画目标的索引 |
| `targetsLength` | 总动画目标数 |

```javascript
anime({
  targets: '.function-based-params-demo .el',
  translateX: 270,
  direction: 'alternate',
  loop: true,
  delay: function(el, i, l) {
    return i * 100;
  },
  endDelay: function(el, i, l) {
    return (l - i) * 100;
  }
