anime.js使用`anime.setDashoffset()`方法获取到SVG路径的长度并将此长度设置为SVG的`'stroke-dasharray'`值，并返回该长度，再使用`strokeDashoffset`将SVG的`'stroke-dashoffset'`属性值在[from to](https://www.animejs.cn/documentation/#fromToValues)格式中产生动画从而创建路径绘制效果。

```
//从起点开始画完
strokeDashoffset: [anime.setDashoffset, 0] 

//从一半开始画完
strokeDashoffset: function(el) { var svgLength = anime.setDashoffset(el); return [svgLength*0.5, 0]; } 
```

